oli-obk has completed a rewrite of the TAIT inference engine so that it matches the inference behavior of the RFC. This rewrite has been largely completed on a branch and is in the process of landing. It requires a number of supporting changes, such as improvements to NLL diagnostics. The semantics that were implemented are briefly defined as follows. First, each TAIT has a "defining scope" based on where it appears: In a module-level type alias: the defining scope is the enclosing module. In the value of an associated type: the defining scope is the impl. Within that defining scope, each item (function, etc) that references the TAIT defines a value for the TAIT based on the results of type-checking. Essentially, the TAIT's value is assumed at first to be an unbound inference variable, and we solve for whatever value of that variable will make the function type check. Each item must completely define the hidden type without relying on other items; further, each item must provide the same value for the hidden type. Example: mod tait { pub type TAIT = impl Debug; // `foo` infers TAIT to be `u32`, // because that is the value needed // to make it type check: pub fn foo() { let x: TAIT = 22_u32; } // `get` also infers TAIT to be `u32`, // because that is the value needed // to make it type check: pub fn get() -> TAIT { 22_u32; } // `take` also infers TAIT to be `u32`, // because that is the value needed // to make it type check. Calling `take` // from *outside* the module would not // be possible except by providing a return // value from `get`. pub fn take(x: TAIT) { let y: u32 = x; } // Other also constraints TAIT to be `u32`, // albeit indirectly. pub fn other() { take(22_u32); }
} Outside of the defining scope, references to the type TAIT are opaque. The code is not permitted to rely on the hidden type, though it may peek at the auto traits implemented by the hidden type: mod tait { ... /* as above */ ... } fn main() { // Allowed tait::take(tait::get()); // ERROR-- The hidden type is not visible outside of // the module `tait`, so we can't rely on it being // `u32`. tait::take(44_u32); // ok -- TAIT is an `impl Debug` is_debug::<tait::TAIT>(); // ok -- auto traits can rely on the hidden type, // and `u32: Send` is_send::<tait::TAIT>(); // error -- even though `u32` implements `Display`, // we don't know the hidden type is_display::<tait::TAIT>();
} fn is_send<T: Send>() { }
fn is_debug<T: Debug>() { }
fn is_display<T: Display>() { }

