We would like to support -> impl Trait in traits and impls. One of the questions that has been blocking progress is the question of how to name the resulting associated type. In other words, the syntax trait Foo { fn bar(&self) -> impl Debug + '_;
} is equivalent to something like this but where Bar is an implicit associated type trait Foo { type Bar<'me> = impl Debug + 'me; fn bar(&self) -> Self::Bar<'_>;
} The problem is that users have no way to name Bar, and hence no way to name the return type of bar. There have been numerous proposals to address this, but the most straightforward -- and also the most enabling -- seems to be allowing users to get access to the "zero-sized fn type" that represents bar. The idea would be to define an associated type for every fn item, so that Foo::bar identifies the associated type for this fn in general, and <T as Foo>::bar identifies the associated type for the function as implemented for the type T. This permits you to access the return type by writing T::bar::Output, for example, although we will have to extend the type checker to accommodate relative associated types like that (the full syntax would be <<T as Foo>::bar as FnOnce>::Output). These are the known questions to address in the evaluation doc: Can you name top-level functions or other sorts of functions? What about the constructor functions for tuple structs or enum variants? How to manage associated types and fns with the same name? Do we have an unambiguous syntax such as T::fn(bar) to resolve that? (This might apply to constructor functions as well.)

