nightly Rust has a concept of type aliases , which let you declare one type name as an alias for another: type Integer = i32; Type aliases can be useful for giving a short alias for some complex type. For example, imagine we had a module odd that defined an odd_integers function. odd_integers(x, y) returns an iterator over all the odd integers between x and y. Because the full return type is fairly complicated, the module defines a type alias OddIntegers that people can use to refer to it. mod odd { pub type OddIntegers = std::iter::StepBy<std::ops::Range<u32>>; pub fn odd_integers(mut start: u32, stop: u32) -> OddIntegers { if (start % 2) == 0 { start += 1; } (start..stop).step_by(2) }
} Of course, typing that long type is kind of annoying. Moreover, there are some types in Rust that don't have explicit names. For example, another way to write the "odd integers" iterator would be to call filter with a closure. But if you try to write out the type for that, you'll find that you need to give a name to the type representing the closure itself, which you can't do! mod odd { pub type OddIntegers = std::iter::Filter<std::ops::Range<u32>, /* what goes here? */>; pub fn odd_integers(mut start: u32, stop: u32) -> OddIntegers { (start..stop).filter(|x| x % 2 != 0) }
}

