Similarly, it is not ok to have functions that only partially constrain and impl Trait. Consider this example: type SomethingDebug = impl Debug; fn something_debug() -> SomethingDebug { // Constrains SomethingDebug to `Option<_>` // (where `_` represents "some type yet to be inferred") None
} Here, the something_debug function constrains SomethingDebug to be some sort of Option, but it doesn't say the full type. We only have Option<_>. That's not good enough. You could change this function to specify what kind of option it is, though, and that would be fine: type SomethingDebug = impl Debug; fn something_debug() -> SomethingDebug { // Constrains SomethingDebug to `Option<()>` None::<()>
}

