![nightly][] [planning rfc]: https://img.shields.io/badge/status-draft%20rfc-informational [accepted rfc]: https://img.shields.io/badge/status-accepted%20rfc-informational [needs decision]: https://img.shields.io/badge/status-needs%20decision-informational [stable]: https://img.shields.io/badge/status-stable-success [nightly]: https://img.shields.io/badge/status-nightly-important [may-change]: https://img.shields.io/badge/warning-implementation%20may%20change-critical Type alias impl Traits can also be generic: type SomeTupleIterator<I, J> = impl Iterator<Item = (I, J)>; The values that you use for these generic parameters, however, are subject to some restrictions. In particular, type aliases can only be used with other generic types that are in scope, and each parameter must be distinct. Example: fn foo1<A, B>() -> SomeTupleIterator<A, B> { /* ok */ }
fn foo2<A, B>() -> SomeTupleIterator<B, A> { /* ok */ }
fn foo3<A, B>() -> SomeTupleIterator<A, A> { /* not ok -- same parameter used twice */ }
fn foo4<A, B>() -> SomeTupleIterator<A, u32> { /* not ok -- u32 is not a type parameter */ } These rules ensure that inference is tractable. Consider the case of -> SomeTupleIterator<A, u32>. Imagine that foo4 returned an iterator over (A, u32) tuples. How do we translate that value to the hidden type for SomeTupleIterator? There would actually be multiple possibilities. Either it would be an iterator over (I, J) (with I = A and J = u32 in this case), or an iterator over (I, u32) (with I = A and J unused).

