Each -> impl Trait notation appearing in a trait fn return type is desugared to an anonymous associated type; the name of this type is a fresh name that cannot be typed by Rust programmers. In this RFC, we will use the name $ when illustrating desugarings and the like. As a simple example, consider the following (more complex examples follow): trait NewIntoIterator { type Item; fn into_iter(self) -> impl Iterator<Item = Self::Item>;
} // becomes trait NewIntoIterator { type Item; type $: Iterator<Item = Self::Item>; fn into_iter(self) -> <Self as NewIntoIterator>::$;
}

66.body:
Each -> impl Trait notation appearing in a trait impl fn return type is desugared to the same anonymous associated type $ defined in the trait along with a function that returns it. The value of this associated type $ is an impl Trait. impl NewIntoIterator for Vec<u32> { type Item = u32; fn into_iter(self) -> impl Iterator<Item = Self::Item> { self.into_iter() }
} // becomes impl NewIntoIterator for Vec<u32> { type Item = u32; type $ = impl Iterator<Item = Self::Item>; fn into_iter(self) -> <Self as NewIntoIterator>::$ { self.into_iter() }
}

