Using -> impl Trait notation in a trait requires that all trait impls also use -> impl Trait notation in their retrn types. Similarly, using -> impl Trait notation in an impl is only legal if the trait also uses that notation: trait NewIntoIterator { type Item; fn into_iter(self) -> impl Iterator<Item = Self::Item>;
} // OK:
impl NewIntoIterator for Vec<u32> { type Item = u32; fn into_iter(self) -> impl Iterator<Item = u32> { self.into_iter() }
} // Not OK:
impl NewIntoIterator for Vec<u32> { type Item = u32; fn into_iter(self) -> vec::IntoIter<u32> { self.into_iter() }
} Rationale: Maximizing forwards compatibility. We may wish at some point to permit impls and traits to diverge but there is no reason to do it at this time.

