As with -> impl Trait in other kinds of functions, the hidden type for -> impl Trait in a trait may reference any of the type or const parameters declared on the impl or the method; it may also reference any lifetime parameters that explicitly appear in the trait bounds ( details ). We say that a generic parameter is captured if it may appear in the hidden type. When desugaring, captured parameters from the method are reflected as generic parameters on the $ associated type. Furthermore, the $ associated type has the required brings whatever where clauses are declared on the method into scope (excepting those which reference other parameters that are not captured). This transformation is precisely the same as the one which is applied to other forms of -> impl Trait, except that it applies to an associated type and not a top-level type alias. Exaample: trait RefIterator for Vec<u32> { type Item<'me> where Self: 'me; fn iter<'a>(&'a self) -> impl Iterator<Item = Self:Item<'a>>;
} // Since 'a is named in the bounds, it is captured.
// `RefIterator` thus becomes: trait RefIterator for Vec<u32> { type Item<'me> where Self: 'me; type $<'a>: impl Iterator<Item = Self::Item<'a>> where Self: 'a; // Implied bound from fn fn iter<'a>(&'a self) -> Self::$<'a>;
}

