"Return position" impl Trait (RPIT) generally refers to an "anonymous" opaque type whose value is inferred by the compiler : fn odd_integers(start: u32, stop: u32) -> impl Iterator<Item = u32> { (start..stop).filter(|i| i % 2 == 0)
} // becomes something like: type OddIntegers = impl Iterator<Item = u32>;
fn odd_integers(start: u32, stop: u32) -> OddIntegers { (start..stop).filter(|i| i % 2 == 0)
} When using RPIT in traits , this anonymous type is a kind of associated type: trait IntoIntIterator { fn into_int_iter(self) -> impl Iterator<Item = u32>;
} // becomes trait IntoIntIterator { // desugared type IntoIntIter: Iterator<Item = u32>; fn into_int_iter(self) -> Self::IntoIntIter;
} In both cases, it would sometimes be nice to be able to name that return type! Of course, people can introduce type aliases or associated types (similar to the desugared form), but that is inconvenient, and it requires that the API author has made sure to do so.
